import Search from '../components/Banner';
import Banner from '../components/Banner';
import GoodsList from '../components/GoodsList';

class Home extends Component {
    render() {
        return (
            <div>
                
                <Banner />
                <GoodsList />
            </div>
        );
    }
}

export default Home;
